import React, { useEffect } from "react";
import QuestionsList from './components/QuestionsList';
import Toolbar from './components/Toolbar';
import UserInfo from './components/UserInfo';

function UserProfile(props) {
    var urlString = "http://localhost:8080/api/v1/user/" + props.postId

    useEffect(() => {
        fetch(urlString)
            .then(response => response.json().then(function(json) {
                if(json === null) {
                    return
                }
            }));
    }, [])

    return(
        <>
            <Toolbar />

            <div id="spacer-div" style={{height: "50px"}}></div>

            <div style={{float:"left", display:"inline", width: "30%"}}>
            <UserInfo postId={props.postId} hidden="true"/>
            </div>

            <div style={{float:"left", display:"inline", width: "50%"}}>
            <QuestionsList postId={props.postId} hidden="true"/>
            </div>
        </>
    )
}

export default UserProfile;
